import { useState } from "react";
import { getFullScheduleByUserId } from "../../api/peopleApi";

function ScheduleView() {
  const [userId, setUserId] = useState("");
  const [regular, setRegular] = useState([]);
  const [workHours, setWorkHours] = useState([]);
  const [timeOff, setTimeOff] = useState([]);

  const load = async () => {
    if (!userId) return;

    try {
      const data = await getFullScheduleByUserId(userId);

      console.log("FULL SCHEDULE RESPONSE:", data);

      setRegular(data.regularShifts || []);
      setWorkHours(data.workHours || []);
      setTimeOff(data.timeOffRequests || []);
    } catch (err) {
      console.error("Schedule load error:", err);
      setRegular([]);
      setWorkHours([]);
      setTimeOff([]);
    }
  };

  return (
    <div style={{ maxWidth: 1100 }}>
      <h2>üìÖ Employee Schedule</h2>

      <input
        placeholder="User ID"
        value={userId}
        onChange={e => setUserId(e.target.value)}
      />
      <button onClick={load}>Load</button>

      {/* REGULAR SHIFTS */}
      <h3>üîÅ Regular Weekly Shifts</h3>
      <table border="1" width="100%">
        <thead>
          <tr><th>Day</th><th>Start</th><th>End</th></tr>
        </thead>
        <tbody>
          {regular.length === 0 && (
            <tr><td colSpan="3">No regular shifts</td></tr>
          )}
          {regular.map((r, i) => (
            <tr key={i}>
              <td>{r.dayOfWeek}</td>
              <td>{r.startTime}</td>
              <td>{r.endTime}</td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* WORK HOURS */}
      <h3>‚è±Ô∏è Actual Work Hours</h3>
      <table border="1" width="100%">
        <thead>
          <tr><th>Date</th><th>In</th><th>Out</th></tr>
        </thead>
        <tbody>
          {workHours.length === 0 && (
            <tr><td colSpan="3">No records</td></tr>
          )}
          {workHours.map((w, i) => (
            <tr key={i}>
              <td>{w.date}</td>
              <td>{w.checkInTime}</td>
              <td>{w.checkOutTime}</td>
            </tr>
          ))}
        </tbody>
      </table>

      {/* TIME OFF */}
      <h3>üõë Time-Off Requests</h3>
      <table border="1" width="100%">
        <thead>
          <tr><th>Date</th><th>From</th><th>To</th><th>Status</th></tr>
        </thead>
        <tbody>
          {timeOff.length === 0 && (
            <tr><td colSpan="4">No requests</td></tr>
          )}
          {timeOff.map((t, i) => (
            <tr key={i}>
              <td>{t.date}</td>
              <td>{t.startTime}</td>
              <td>{t.endTime}</td>
              <td>{t.approved ? "‚úÖ Approved" : "‚è≥ Pending"}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
}

export default ScheduleView;
